import React from "react";
import './AddUser.css'
const AddUser = () => {
    return (
        <div className="user-details">
            <form>
                <div>
                    <label>Username</label>
                    <input></input>
                </div>
                <div>
                    <label>Age</label>
                    <input></input>
                </div>
                <button>Add User</button>
            </form>
        </div>
    )
}

export default AddUser;
